// StockDataFetcher.js

import React, { useState } from 'react';
import axios from 'axios';

const StockDataFetcher = () => {
  const [symbol, setSymbol] = useState('');
  const [period, setPeriod] = useState('1mo'); // Default period

  const handleSymbolChange = (event) => {
    setSymbol(event.target.value);
  };

  const handlePeriodChange = (event) => {
    setPeriod(event.target.value);
  };

  const fetchData = async () => {
    try {
      const response = await axios.get(`/forex/data?symbol=${symbol}&period=${period}`);
      console.log(response.data); // Log the fetched data for testing
      // Process the data as needed
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    fetchData();
  };

  return (
    <div>
      <h2>Stock Data Fetcher</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Select Symbol:
          <input type="text" value={symbol} onChange={handleSymbolChange} />
        </label>
        <br />
        <label>
          Select Period:
          <select value={period} onChange={handlePeriodChange}>
            <option value="1d">1 Day</option>
            <option value="1mo">1 Month</option>
            <option value="6mo">6 Months</option>
            <option value="1y">1 Year</option>
            <option value="5y">5 Years</option>
          </select>
        </label>
        <br />
        <button type="submit">Fetch Data</button>
      </form>
    </div>
  );
};

export default StockDataFetcher;
